import './App.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import LogReg from './views/LogReg';

function App() {
  return (
    <div className="App">
      <h1>Hello World</h1>
      <BrowserRouter>
        <Routes>
          <Route element={<LogReg />} path="/home" />

        </Routes>

      </BrowserRouter>
    </div>
  );
}

export default App;
